script: |
  super -f text -I q5649.spq | sort > q5649.out

inputs:
  - name: q5649.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT + ( + col1 ) * + - 0 + + + ( - + col2 ) > - ( + col1 ) / col0 * - - col1 * + col2 / - col0;
  - name: tab1

outputs:
  - name: q5649.out
    data: |
      51	14	96
      85	5	59
      91	47	68
